package edu.agh.lab5.C;

import org.junit.Test;

import static org.junit.Assert.*;

public class SubstringTest {

	@Test
	public void isResultCorrect() {
		String a = "abcd";
		String b  = "cdabcdab";
		Substring substr = new Substring();

		assertEquals(substr.substring(a,b), 3);
	}

	@Test
	public void checkNullHandling() {
		String a = null;
		String b  = "test";
		Substring substr = new Substring();

		assertEquals(substr.substring(a,b), -1);
	}

	@Test
	public void checkWhetherInputOrderMatters() {
		String a = "abcd";
		String b  = "cdabcdab";
		Substring substr = new Substring();

		assertTrue(substr.substring(a,b) != substr.substring(b,a));
	}

	@Test (timeout = 50)
	public void checkTimeoutForHugeString() {
		String a = "";
		String b  = "";
		Substring substr = new Substring();

		substr.substring(b,a);
	}

}